import React from "react";
import { useState } from "react";
const New = () => {
  const [priceValue, setPriceValue] = React.useState(30);
   

  const handleChange=(e)
  return (
    <div
      style={{
        paddingTop: "60px",
        paddingBottom: "120px",
        display: "flex",
        justifyContent: "space-between",
        width: "90%",
      }}
    >
      <div
        style={{
          width: "100%",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "column",
          gap: "10px",
        }}
      >
        <div
          style={{
            fontSize: "50px",
            width: "50%",
            fontWeight: "600",
            paddingLeft: "80px",
          }}
        >
          <span style={{ color: "red" }}>Airbnb it.</span>
        </div>
        <div style={{ fontSize: "50px", fontWeight: "600" }}>
          You could earn
        </div>
        <div style={{ fontWeight: "600", fontSize: "60px",alignItems:"center",display:"flex",flexDirection:"column" }}>
          ${priceValue}{" "}
        <p style={{fontSize:"20px"}}> {10} nights at an estimated â‚¹3,581 a night</p>
        </div>
        <div>
          <input
            type="range"
            name="destination"
            id="destination"
            min="150"
            max="1000"
            value={priceValue}
            step="10"
            // onChange={(e) => setPriceValue(e.target.value)}
            onChange={handleChange}
            style={{ width: "360px" }}
          />
        </div>
        <div style={{paddingBottom:"20px"}}>Learn how we estimate your earnings</div>

        <div className="l" style={{display:"flex",flexDirection:"row",alignItems:"center",gap:"20px"}}>
          <div >
            <img style={{height:"24px"}} src="./img/s.png" alt="" />
          </div>
          <div>
            <div style={{fontWeight:"500"}}>Pune</div>
            <div style={{opacity:"0.6"}}>Entair Place .2 Bedrooms</div>
          </div>
        </div>
      </div>
      <div style={{ width: "50%" }}>
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242117.70906659198!2d73.69815111553402!3d18.524870612981903!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bc2bf2e67461101%3A0x828d43bf9d9ee343!2sPune%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1716360540118!5m2!1sen!2sin"
          width="600"
          height="450"
          style={{ border: "0" }}
          allowfullscreen=""
          loading="lazy"
          referrerpolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
};

export default New;
